import React from 'react';
import axios from "axios";


function UserDescription(props) {


  const Delete = () => {
    console.log('okk');
    axios.post(`http://localhost:5000/api/DeleteUser?email=${props.email}`)
    .then(res => {
        if(res.data.success===true){
        console.log('deleted')
        }else {
        console.log('error in deleting user')
        }
    })
  }

  return (
    <tr>
      <td>{props.id}</td>
      <td>{props.email}</td>
      <td>{props.firstname}</td>
      <td>{props.lastname}</td>
      <td><button type="button" onClick={Delete} className="btn btn-danger">Delete</button>
      </td>

  </tr>
 
  );
}

export default UserDescription
